var swiper1=new Swiper(".swiper1",{slidesPerView:1,spaceBetween:30,loop:!0,autoplay:{delay:3e3,disableOnInteraction:!1}}),swiper2=new Swiper(".swiper2",{direction:"horizontal",loop:!0,spaceBetween:20,slidesPerView:3,centeredSlides:!0,breakpoints:{400:{slidesPerView:1,spaceBetween:0},800:{slidesPerView:2,spaceBetween:10},1200:{slidesPerView:3,spaceBetween:20}},pagination:{el:".swiper-pagination",clickable:!0},navigation:{nextEl:".swiper-button-next",prevEl:".swiper-button-prev"}});function initMap(){new google.maps.Map(document.getElementById("map"),{center:{lat:48.43306439179746,lng:34.84722679687054},zoom:12,mapId:"3078384c4f8f2ab9"})}const hamburger=document.querySelector(".hamburger"),menu=document.querySelector(".menu");hamburger.addEventListener("click",()=>{hamburger.classList.toggle("active"),menu.classList.toggle("active")});